webpackJsonp([1900],{"./node_modules/json-loader/index.js!./.cache/json/articles-css-css-framework-materialize.json":function(e,a){e.exports={data:{markdownRemark:{html:'<h1>CSS Framework Materialize</h1>\n<p>Materialize is a Responsive CSS framework based on Google\'s <a href="https://design.google.com/spec/">Material Design</a> Language.</p>\n<h2>Getting Started</h2>\n<p>Here is a simple HTML template which includes the latest compiled and minified CSS and Javascript for the Materialize library.</p>\n<pre><code>&#x3C;!DOCTYPE html>\n&#x3C;html lang="en">\n  &#x3C;head>\n    &#x3C;meta charset="utf-8">\n    &#x3C;meta name="viewport" content="width=device-width, initial-scale=1">\n    &#x3C;title>Materialize Template&#x3C;/title>\n    &#x3C;link href="http://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet">\n    &#x3C;link type="text/css" rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/materialize/0.97.6/css/materialize.min.css" media="screen,projection"/>\n  &#x3C;/head>\n  &#x3C;body>\n    &#x3C;h1>Hello World&#x3C;/h1>\n    &#x3C;!-- Add all HTML Code here -->\n    &#x3C;script src="https://ajax.googleapis.com/ajax/libs/jquery/1.11.3/jquery.min.js">&#x3C;/script>\n    &#x3C;script src="https://cdnjs.cloudflare.com/ajax/libs/materialize/0.97.6/js/materialize.min.js">&#x3C;/script>\n  &#x3C;/body>\n&#x3C;/html>\n</code></pre>\n<p>We have used a CDN in this example, but you can checkout other ways of installing Materialize <a href="http://materializecss.com/getting-started">here</a>.</p>\n<h2>Learning Resources</h2>\n<ul>\n<li>The official documentation for Materialize is available <a href="https://materializecss.com/">here</a>.</li>\n<li>Checkout Materialize\'s open source GitHub repository <a href="https://github.com/Dogfalo/materialize">here</a>.</li>\n<li><a href="https://scotch.io/tutorials/make-material-design-websites-with-the-materialize-css-framework">Here</a> is a handy tutorial on using Materialize.</li>\n</ul>',frontmatter:{title:"CSS Framework Materialize",parent:"/home/stuart/guides/src/pages/articles/css/css-framework-materialize/index.md absPath of file"}}},pathContext:{slug:"/articles/css/css-framework-materialize/"}}}});
